
import java.util.Scanner;


public class AddingDigits {

    
    public static void main(String[] args) {
        Scanner input = new Scanner(System.in);
        int a = input.nextInt();
        int b = input.nextInt();
        int n = input.nextInt();
        for (int i = 0; i < 10; i++) {
            int aa = Integer.parseInt(a + "" + i);
            if (aa % b == 0) {
                String aaa = aa + "";
                if (n / 50000 > 0) {
                    for (int j = 0; j < n / 50000; j++) {
                        aaa = aaa + "";
                        n -= 50000;
                    }
                }
                if (n / 10000 > 0) {
                    for (int j = 0; j < n / 10000; j++) {
                        aaa = aaa + "";
                        n -= 10000;
                    }
                }
                if (n / 1000 > 0) {
                    for (int j = 0; j < n / 1000; j++) {
                        aaa = aaa + "";
                        n -= 1000;
                    }
                }
                for (int j = 0; j < n - 1; j++) {
                    aaa = aaa + "0";
                }
                System.out.println(aaa);
                return;
            }
        }
        System.out.println("-1");
    }

}
